	CASE 
    
    WHEN TIPO = 1 THEN
		id is not null
        
	WHEN TIPO = 2 THEN
		numeross LIKE CONCAT(COMODIN,'%')
        
	WHEN TIPO = 3 THEN
		fechaNacimiento = STR_TO_DATE(COMODIN,'%d/%m/%Y')
	
    WHEN TIPO = 4 THEN
		REPLACE(CONCAT(nombre,apellido),' ','') LIKE CONCAT('%',COMODIN,'%')
    END;
        
END ;;
